Content:
Au Parti libéral du Québec, on a un vrai plan pour améliorer l’accès à la propriété et à un logement abordable  :
🏗 Construction de logements abordables;
👉Augmentation l’offre de logements sociaux;
🏡Abolir la taxe de bienvenue à l’achat d’une 1ère propriété;
👍Bonifier le RAP.

